import React, { useState } from 'react';
import './App.css';
import FileUpload from './components/FileUpload';
import Button from 'react-bootstrap/Button';
import 'bootstrap/dist/css/bootstrap.min.css';

const App = () => {
  const [analyzedData, setAnalyzedData] = useState(null);
  const [searchString, setSearchString] = useState('');
  const [localSearchString, setLocalSearchString] = useState(''); // Store the local search string

  const handleFileUpload = (data) => {
    setAnalyzedData(data);
  };

  const handleSearchInputChange = (event) => {
    setLocalSearchString(event.target.value);
  };

  const handleSearchButtonClick = () => {
    setSearchString(localSearchString);
  };

  const handleSearchInputKeyPress = (event) => {
    if (event.key === 'Enter') {
      setSearchString(localSearchString);
    }
  };

  return (
    <div className="container mt-5">
      {/* ... */}
      <div className="row justify-content-center">
        <div className="col-lg-6">
          <div className="input-group mb-3">
            <input
              type="text"
              className="form-control"
              value={localSearchString}
              onChange={handleSearchInputChange}
              onKeyPress={handleSearchInputKeyPress}
              placeholder="Enter search string"
            />
            <Button className="btn btn-primary" onClick={handleSearchButtonClick}>
              Search
            </Button>
          </div>
          <FileUpload searchString={searchString} onFileUpload={handleFileUpload} />
        </div>
      </div>
      {/* ... */}
    </div>
  );
};

export default App;
